                        N.PlaySoundFrontend(-1, "NAV_UP_DOWN", "HUD_FRONTEND_DEFAULT_SOUNDSET", true)
                    end
                end

                return false
            else
                WHandle.debugPrint("Failed to create " .. buttonText .. " button: " .. tostring(WHandle.DataStore.currentMenu) .. " menu doesn't exist")

